pragma solidity ^0.5.2;

import { Auction } from './Auction.sol';

contract AuctionFactory {
    address[] public auctions;
    mapping(address=>Auction) auctionList;
    event AuctionCreated(address auctionContract, address owner, uint numAuctions, address[] allAuctions);
    event getAddress(address);
    event getBlockNumber(uint);
    constructor()public {
    }

    function createAuction(uint bidIncrement, uint endBlock, string memory ipfsHash) public returns(address) {
        Auction newAuction = new Auction(msg.sender, bidIncrement, endBlock, ipfsHash);
        //auctions.push(address(newAuction));
        //auctionList[address(newAuction)]=newAuction;
        //emit AuctionCreated(address(newAuction), msg.sender, auctions.length, auctions);
        emit getAddress(address(newAuction));
        return (address(newAuction));
    }

    function allAuctions() view public returns (address[] memory) {
        return auctions;
    }
}
